import React, { Component } from "react";
import { Container, Button, Row, Col } from "react-bootstrap";

class Primitiva extends Component {
  constructor(props) {
    super(props);
    // this._service = new EuroService();
    this.state = {};
  }

  render() {
    let arrButtons = [];
    for (let i = 1; i < 10; i++) {
      arrButtons.push(
        <Button variant="dark" type="submit">
          {i}
        </Button>
      );
    }
    return (
      <Container>
        <section>
          <h1>Primitiva</h1>
        </section>
        <Row>
          <Col xs={1}>
            <p>1</p>
            {arrButtons}
          </Col>
          <Col xs={1}>
            <Button variant="dark" type="submit">
              10
            </Button>
            <Button variant="dark" type="submit">
              11
            </Button>
            <Button variant="dark" type="submit">
              12
            </Button>
            <Button variant="dark" type="submit">
              13
            </Button>
            <Button variant="dark" type="submit">
              14
            </Button>
            <Button variant="dark" type="submit">
              15
            </Button>
            <Button variant="dark" type="submit">
              16
            </Button>
            <Button variant="dark" type="submit">
              17
            </Button>
            <Button variant="dark" type="submit">
              18
            </Button>
            <Button variant="dark" type="submit">
              19
            </Button>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default Primitiva;
